func Test_genAllSubArrayList(t *testing.T) {
	type args struct {
		nums []int
	}
	tests := []struct {
		name string
		args args
		want [][]int
	}{
		// TODO: Add test cases.
		{
			name: "empty",
			args: args{
				nums: []int{},
			},
			want: [][]int{},
		},
		{
			name: "normal test",
			args: args{
				nums: []int{1, 2, 3},
			},
			want: [][]int{{1}, {2}, {3}, {1, 2}, {2, 3}, {1, 2, 3}},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			assert.Equalf(t, tt.want, genAllSubArrayList(tt.args.nums), "genAllSubArrayList(%v)", tt.args.nums)
		})
	}
}

